package main

import (
	"fmt"
	// "math"
)

/*
test case:
"cbaebabacd", "abc"
	[0, 6]

	Input:
s: "abab" p: "ab"

Output:
[0, 1, 2]

Input
"ababababab"
"aab"
Output
[0,1,2,3,4,5,6,7]
Expected
[0,2,4,6]

""

""

*/
func main() {
	res := findAnagrams("cbaebabacd", "abc")
	fmt.Println(res)
}

func findAnagrams(s string, p string) []int {
	res := make([]int, 0)
	if len(s) == 0 || len(p) == 0 {
		return res
	}
	m := make(map[byte]int, 0)
	left := 0
	right := 0
	cnt := len(p)
	n := len(s)
	for i := 0; i < len(p); i++ {
		m[p[i]]++
	}
	for right < n {
		if v, ok := m[s[right]]; ok {
			if v >= 1 {
				cnt--
			}
			m[s[right]]--
		}
		right++
		if cnt == 0 {
			res = append(res, left)
		}

		if (right - left + 1) == len(p) {
			if v, ok := m[s[left]]; ok {
				if v >= 0 {
					cnt++
				}
				m[s[left]]++
			}
			left++
		}
	}
	return res
}
